import styled from "styled-components"

const Header = styled.div`
    color:white;
    font-size:1.5em;
    display:flex;
    flex-direction:row;
    align-items:center;
    width:100%;
    background-color:#448487;
    padding:10px 0;
    position:fixed;
    justify-content:center;
    .option{
        margin:0 20px;
    }
    &.left{
        align-self:flex-start;
    }
`
export default Header
